require('../assets/simsun-normal')

drawTitles = (doc, title, fontsize, x, y) => {
  doc.setFont('simsun')
  doc.setFontSize(fontsize);
  doc.text(x, y, title)
}

drawHeader = (doc, text, y) => {
  doc.setFont('simsun')
  doc.setFontSize(10);
  doc.text(10, y, `报告编号:${text}`)
  doc.text(180, y, `安冷科技`)
}

drawLogo = (doc, x, y, scale) => {
  var imgData = 'data:image/jpg;base64,'
  doc.addImage(imgData, "JPEG", x, y, 30 * scale, 11 * scale);
}

drawPageNo = (doc, pageNo, pageCount) => {
  doc.setFont('simsun')
  doc.setFontSize(12);
  doc.text(100, 290, `第${pageNo}页 共${pageCount}页`)
}
module.exports = {
  drawTitles,
  drawHeader,
  drawLogo,
  drawPageNo,
}